resources.string:
1. Aile üyeleri platformda daha fazla zaman geçirdiklerinde aile daha üst sıralarda yer alır. Örneğin, günlük giriş, odada kalma süresi, hediye verme.
2. Aile üyesi aktivite puanları nasıl kazanılır:
Günlük giriş / mumber için kazanılan ①20 puan;
②Her üye, günde 50 puan kazanmak için 10 dakika boyunca herhangi bir odada kalır;
③Diğer kullanıcılara hediye gönder, 1 elmas = 1 aktivite puanı, 10 fasulye = 1 aktivite puanı.
3. Haftalık liste ve aylık liste toplam aile etkinliğini içerir ve haftalık veya aylık olarak güncellenir.
